import Payment from "./payment";

function Content(props){
  
  return (
    <div class="content">
      <div class="right-left-wrapping-div">
      <div class="left-side-content-div">

      </div>
      <div class="right-side-content-div">
        <Payment />
      </div>
      </div>
    </div>
  )
}

export default Content;
